// Prepare Python script for garth
const today = new Date().toISOString().split('T')[0];

const pythonScript = `
import json
import os
import sys
from datetime import date, datetime
from pathlib import Path

try:
    import garth
except ImportError:
    print(json.dumps({"error": "garth not installed. Run: pip install garth"}))
    sys.exit(1)

# Session path for persistence
SESSION_PATH = Path(os.environ.get('GARMIN_SESSION_PATH', '/app/data/garmin_session'))

def main():
    result = {
        "date": "${today}",
        "success": False,
        "data": {},
        "error": None
    }

    try:
        # Try to resume existing session
        if SESSION_PATH.exists():
            garth.resume(SESSION_PATH)
        else:
            # Login with credentials from environment
            email = os.environ.get('GARMIN_EMAIL')
            password = os.environ.get('GARMIN_PASSWORD')

            if not email or not password:
                result["error"] = "GARMIN_EMAIL and GARMIN_PASSWORD environment variables required"
                print(json.dumps(result))
                return

            garth.login(email, password)
            # Save session for next time
            SESSION_PATH.parent.mkdir(parents=True, exist_ok=True)
            garth.save(SESSION_PATH)

        target_date = date.fromisoformat("${today}")

        # Fetch Daily Stats
        try:
            daily_stats = garth.connectapi(
                f"/usersummary-service/usersummary/daily/{target_date.isoformat()}"
            )

            result["data"]["steps"] = daily_stats.get("totalSteps", 0)
            result["data"]["active_calories"] = daily_stats.get("activeKilocalories", 0)
            result["data"]["total_calories"] = daily_stats.get("totalKilocalories", 0)
            result["data"]["intensity_minutes"] = (
                daily_stats.get("moderateIntensityMinutes", 0) + 
                daily_stats.get("vigorousIntensityMinutes", 0)
            )
            result["data"]["floors_climbed"] = daily_stats.get("floorsAscended", 0)
            result["data"]["resting_hr"] = daily_stats.get("restingHeartRate", None)
        except Exception as e:
            result["data"]["daily_stats_error"] = str(e)

        # Fetch Sleep Data
        try:
            sleep_data = garth.connectapi(
                f"/wellness-service/wellness/dailySleepData/{target_date.isoformat()}"
            )

            if sleep_data:
                result["data"]["sleep_score"] = sleep_data.get("overallSleepScore", {}).get("value", None)
                result["data"]["sleep_duration_minutes"] = round(sleep_data.get("sleepTimeSeconds", 0) / 60)
                result["data"]["deep_sleep_minutes"] = round(sleep_data.get("deepSleepSeconds", 0) / 60)
                result["data"]["light_sleep_minutes"] = round(sleep_data.get("lightSleepSeconds", 0) / 60)
                result["data"]["rem_sleep_minutes"] = round(sleep_data.get("remSleepSeconds", 0) / 60)
                result["data"]["awake_minutes"] = round(sleep_data.get("awakeSleepSeconds", 0) / 60)
        except Exception as e:
            result["data"]["sleep_error"] = str(e)

        # Fetch Body Battery
        try:
            body_battery = garth.connectapi(
                f"/wellness-service/wellness/bodyBattery/days/{target_date.isoformat()}/1"
            )

            if body_battery and len(body_battery) > 0:
                bb_data = body_battery[0]
                result["data"]["body_battery_charged"] = bb_data.get("charged", 0)
                result["data"]["body_battery_drained"] = bb_data.get("drained", 0)

                # Get start and end values from timeline if available
                timeline = bb_data.get("bodyBatteryValuesArray", [])
                if timeline:
                    result["data"]["body_battery_start"] = timeline[0][1] if timeline[0] else None
                    result["data"]["body_battery_end"] = timeline[-1][1] if timeline[-1] else None
        except Exception as e:
            result["data"]["body_battery_error"] = str(e)

        # Fetch Stress Data
        try:
            stress_data = garth.connectapi(
                f"/wellness-service/wellness/dailyStress/{target_date.isoformat()}"
            )

            if stress_data:
                result["data"]["stress_avg"] = stress_data.get("overallStressLevel", None)
                result["data"]["stress_max"] = stress_data.get("maxStressLevel", None)
                result["data"]["rest_stress_minutes"] = stress_data.get("restStressDuration", 0) // 60
                result["data"]["low_stress_minutes"] = stress_data.get("lowStressDuration", 0) // 60
                result["data"]["medium_stress_minutes"] = stress_data.get("mediumStressDuration", 0) // 60
                result["data"]["high_stress_minutes"] = stress_data.get("highStressDuration", 0) // 60
        except Exception as e:
            result["data"]["stress_error"] = str(e)

        # Fetch HRV Data
        try:
            hrv_data = garth.connectapi(
                f"/hrv-service/hrv/{target_date.isoformat()}"
            )

            if hrv_data:
                result["data"]["hrv_value"] = hrv_data.get("hrvValue", None)
                status = hrv_data.get("status", None)
                if status:
                    # Map status to our enum
                    status_map = {
                        "BALANCED": "balanced",
                        "HIGH": "high", 
                        "LOW": "low",
                        "POOR": "low"
                    }
                    result["data"]["hrv_status"] = status_map.get(status.upper(), "balanced")
        except Exception as e:
            result["data"]["hrv_error"] = str(e)

        result["success"] = True

    except garth.exc.GarthHTTPError as e:
        if "401" in str(e):
            # Session expired, delete and retry
            if SESSION_PATH.exists():
                SESSION_PATH.unlink()
            result["error"] = "Session expired. Will re-authenticate on next run."
        else:
            result["error"] = f"Garmin API error: {str(e)}"
    except Exception as e:
        result["error"] = f"Unexpected error: {str(e)}"

    print(json.dumps(result))

if __name__ == "__main__":
    main()
`;

return {
  python_script: \`python3 -c '\${pythonScript.replace(/'/g, "'\\"'\\"'")}'\`
};

// Parse the Python output
const stdout = $input.first().json.stdout || '';
const stderr = $input.first().json.stderr || '';

try {
  // Find JSON in output (might have other text before/after)
  const jsonMatch = stdout.match(/\{[\s\S]*\}/);
  if (!jsonMatch) {
    return {
      success: false,
      error: `No JSON output found. stdout: ${stdout}, stderr: ${stderr}`
    };
  }

  const result = JSON.parse(jsonMatch[0]);

  if (result.error) {
    return {
      success: false,
      error: result.error
    };
  }

  return {
    success: result.success,
    date: result.date,
    ...result.data
  };

} catch (e) {
  return {
    success: false,
    error: `Failed to parse output: ${e.message}. stdout: ${stdout}, stderr: ${stderr}`
  };
}

